package Chapter1;

public class Gugudan {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub   
		gugudan();

	}
	public static void gugudan(){
		for(int i=2 ; i<10 ; i++){
			for(int j=1 ; j<10; j++){
				System.out.println(i+" * "+j+ " = "+i*j );
				
			}
		}
	}

}
